import React from 'react';
import Button from 'antd/lib/button';
import { Input } from 'antd';
import { Typography } from 'antd';
import CSILogo from './FrontEnd/png/Logo.png';
import './App.css'

const { Title } = Typography;

function App() {
  return (
    <div className="App">
      <header>
          Phone:xxxxxxxxxx
        <hr></hr>
      </header>
      <main>
        <div className="LoginContent">
            <img src={CSILogo} alt='CSILogo' />
            <div className="Content">
              <Title level={3}>User:<Input className="UserInput" /></Title>
              <Title level={3}>PSW:<Input.Password className="UserInput" placeholder="input password" /></Title>

              <Button type="primary" onClick={this.LoginFunction}>Login</Button>
            </div>
        </div>
      </main>
    </div>
  );
}


